window.bookSummaryJSON = "<p><b>My family is cursed, and I’m the next victim.</b></p> <p>At least, that’s what my father believes. His obsession with the sleeping curse that took my mother has driven him mad.</p> <p>Growing up as the daughter of Hollywood royalty put me constantly in the sights of paparazzi. So when an invitation to visit Prince Phillip of Ashea arrives, I jump at the chance to get away from the cameras. He’s the man I’ve wanted since we were both children.</p> <p>But I’ve only ever had him once upon a dream.</p> <p>My prince is everything I envisioned, but a dark brooding presence has worked his way between us. Malachi, his wicked step-brother, weaves his spell around me. I should choose Phillip, but I want Mal just as badly.</p> <p>In the halls of the castle, I discover fate has plans for the three of us.</p> <p>One of them is destined to save me. The other is my curse. </p> <p>And me? I need them both.</p> <p><i>Cursed </i>is a menage Sleeping Beauty retelling with a twist. Two dragons, one princess, and a destiny none of them can escape.</p>"; 
